import React from "react";

class saida extends Component{
  render(){
  return(
    <section>
      <div>
        <ul>
          <li>
            <input type="checkbox" />
            <span>Will puta exemplo</span>
            <button type="button">deletar</button>
          </li>
        </ul>
      </div>
    </section>
  )
  }
}

export default saida;
